import "../assets/css/section.css";

function About() {
  return (
    <div className="section" id="about">
      <div className="section-content">
        <div className="section-header">About Me</div>
        <div className="section-body">I am Jake Busse</div>
      </div>
    </div>
  );
}

export default About;
